                'turn': Object.keys(data).filter(key => data[key].group=="turn"),
                'begin': Object.keys(data).filter(key => data[key].group=="begin")
            }
            
            var overlap = 5
            var position = {x: overlap, y: 100}
            
            function add_endpoint(interface, index, body_data, position){
                //console.log(interface, index, body_data, position)
                var opposite_interface = ((parseInt(interface) + 2 ) % 4).toString()
                var if0_key = pieces['end'][pieces['end'].length * Math.random() << 0]
                //console.log(if0_key)
                var if0_pos = {x: position.x, y: position.y + body_data.interfaces[interface][index] * body_data.scale}
                if(interface === "1"){
                    if0_pos.x = if0_pos.x + body_data.width * body_data.scale
                }
                //drawcircle(if0_pos)
                var if0_path = document.getElementById(if0_key).cloneNode(true)
                var if0_data = data[if0_key]
                if (!if0_data.interfaces[opposite_interface]){
                    var inner = if0_path.innerHTML
                    if0_path. innerHTML = ""
                    var flipgroup = document.createElementNS('http://www.w3.org/2000/svg', 'g')
                    flipgroup.innerHTML = inner
                    flipgroup.setAttribute('transform', `translate(${if0_data.width} 0) scale(-1 1)`)
                    if0_path.appendChild(flipgroup)
                    if0_data.interfaces[opposite_interface] = if0_data.interfaces[((parseInt(opposite_interface) + 2 ) % 4).toString()]
                }
                if (interface === "3"){
                    if0_pos.x = if0_pos.x - if0_data.width * if0_data.scale + overlap
                } else{
                    if0_pos.x = if0_pos.x - overlap
                }
                
                if0_pos.y = if0_pos.y - if0_data.interfaces[opposite_interface][0] * if0_data.scale
                //drawcircle(if0_pos)
                if0_path.setAttribute('transform', `translate(${if0_pos.x} ${if0_pos.y}) scale(${if0_data.scale}) rotate(${if0_data.rotation} ${if0_data.width/2} ${if0_data.height/2})`)
                if0_path.setAttribute('visibility', "visible")
                if0_path.setAttribute('id', if0_path.getAttribute("id") + "_drawing")
                drawing.append(if0_path)
                pieces['end'] = pieces['end'].filter(element => element != if0_key)
                
            }

            while(current_group != 'end' && pieces[current_group].length >= 0){
                if(pieces[current_group].length === 0){
                    current_group = 'end'
                }
                let random_key = pieces[current_group][ pieces[current_group].length * Math.random() << 0]
                if (current_group != 'end' && next_id){
                    random_key = next_id
                }
                console.log(random_key, current_interface)
                let path = document.getElementById(random_key).cloneNode(true)
                let random_data = data[random_key]
                // flip if necessary.
                if (current_group != "begin" && !random_data.interfaces[current_interface]){
                    var inner = path.innerHTML
                    path. innerHTML = ""
                    var flipgroup = document.createElementNS('http://www.w3.org/2000/svg', 'g')
                    flipgroup.innerHTML = inner
                    flipgroup.setAttribute('transform', `translate(${random_data.width} 0) scale(-1 1)`)
                    path.appendChild(flipgroup)
                    random_data.interfaces[current_interface] = random_data.interfaces[((parseInt(current_interface) + 2 ) % 4).toString()]
                }
                
                if (current_group ==="begin" && Object.keys(random_data.interfaces)[0] === "3"){
                    position.x = 1600
                }else{
                    if (current_interface === "1"){
                        position.x = position.x - random_data.width * random_data.scale + overlap
                    } else{
                        position.x = position.x - overlap
                    }
                    
                    position.y = position.y - random_data.interfaces[current_interface][0] * random_data.scale
                }
                //drawcircle(position)
                path.setAttribute('transform', `translate(${position.x} ${position.y}) scale(${random_data.scale}) rotate(${random_data.rotation} ${random_data.width/2} ${random_data.height/2})`)
                path.setAttribute('visibility', "visible")
                path.setAttribute('id', path.getAttribute("id") + "_drawing")
                //path.addEventListener("click", toggle_visibility)
                pieces[current_group] = pieces[current_group].filter(element =>  element != random_key)
                drawing.append(path)
                if(current_group != 'end'){
                    if(random_key === "source"){
                        //add endpoint to interface accross 
                        add_endpoint(((parseInt(current_interface) + 2 ) % 4).toString(), 0, random_data, position)
                        //add endpoint to interface beneith
                        add_endpoint(current_interface, 1, random_data, position)
                    }

                    let remaining_interfaces = Object.keys(random_data.interfaces).filter(interface => interface != current_interface)
                                        
                    if(current_group != 'turn'){
                        current_interface = remaining_interfaces[0]
                    }
                    
                    if(current_group === 'begin' || current_group === 'turn'){
                        current_group = 'straight'
                    }
                    else{
                        current_group = 'turn'
                    }
                    if(current_interface === "1"){
                        position.x = position.x + random_data.width * random_data.scale
                    }
                    position.y = position.y + random_data.interfaces[current_interface][random_data.interfaces[current_interface].length - 1] * random_data.scale
                    //drawcircle(position)
                    current_interface = ((parseInt(current_interface) + 2 ) % 4).toString()
                    
                    next_id = random_data.next
                }
                    
            }
            
        }
        

        
        draw_cave()


        
    </script>
  </body>
</html>
